import { Route, routes } from 'react-router-dom';

import CategoriesPreview from '../categories-preview/categories-preview.component';
import './shop.styles.scss';

const Shop = () => {
	return (
		<routes>
			<Route
				index
				element={CategoriesPreview}
			/>
		</routes>
	);
};

export default Shop;
